import './App.css';

 import Home from './pages/Home';

 import { Router, Route } from 'react-router-dom';




function App() {
  return (
    <Router>
    <div className="App">

      <Navbar />
      <Footer/>
      <Routes>
     <Route path ="/" element = {<Home/>}></Route>

     <Route path ="/drip" element = {<Drip/>}></Route>
     <Route path ="/contact" element = {<Contact/>}></Route>
     </Routes>
     </div>

</Router>

  );
}

export default App;
